import Vue from 'vue';
import VueRouter from 'vue-router';
import loginView from '../views/auth/loginView.vue';

Vue.use(VueRouter);

const routes = [
  { path: '/', component: loginView},
];

const router = new VueRouter({
  routes,
});

export default router;
